import React from 'react';
import './App.css';

function App() {
  return (

    <Router>
    <div className="App">



                    <Switch>


                      <Route path="/contact">
                        <Contact />
                      </Route>

                      <Route path="/About">
                        <About />
                      </Route>

                      <Route path="/Compte">
                        <Compte />
                      </Route>


                    </Switch>



    </div>
  </Router>
  );
}

export default App;
